import logo from '../resources/apex_logo.svg';
import '../App.css';

function Header() {
  return (
    <div className="App-header">
        <header>
            <img src={logo} className="App-logo" alt="logo"/>
            <p>
                ApexBots
            </p>
        </header>
    </div>
  );
}

export default Header;
